import React from "react";
import { NavLink } from "react-router-dom";
import Nav from 'react-bootstrap/Nav'

const navigationBar = () => {
    return (
        <div>
            <Nav variant="pills" defaultActiveKey="/home">
                <Nav.Item>
                    <Nav.Link><NavLink to="/">Active</NavLink></Nav.Link>   
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="link-1"><NavLink >Option 2</NavLink></Nav.Link>    
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="disabled" disabled><NavLink>Disabled</NavLink></Nav.Link>
                </Nav.Item>
            </Nav>
        </div>

    )
}


export default navigationBar;
